// Services.js
import React from 'react';
import classes from './people.module.css';

const services = [
  "PEB-PRE-Engineered Steel Building",
  "Structural Steel",
  "Rooftop Installation Service",
  "Industrial Structural Painting",
  "Warehouse Shed Fabrication Services",
  "Factory Shed Fabrication Services",
  "Pipeline Fabrication Services",
  "Chemical Anchor Installation",
  "HILTi Anchoring Services",
  "Core Cutting Services",
  "HILTi Firestop",
  "Storage Solutions",
  "Technical Advisory Service"
];

function Services() {
  return (
    <section className={`${classes.section} ${classes.services}`}>
      <h2>Our Services</h2>
      <ul className={classes.servicesList}>
        {services.map((service, index) => (
          <li key={index} className={classes.serviceItem}>
            <img src={`/icons/${service.replace(/\s+/g, '-').toLowerCase()}.png`} alt={service} />
            <span>{service}</span>
          </li>
        ))}
      </ul>
    </section>
  );
}

export default Services;
